import React, { createContext, useContext, useState } from 'react';

const PropertyContext = createContext();

export const usePropertyContext = () => useContext(PropertyContext);

export const PropertyProvider = ({ children }) => {
  const [currentMarketValue, setCurrentMarketValue] = useState('');
  const [carpetArea, setCarpetArea] = useState('');
  const [pincode, setPincode] = useState('');
  const [buildingAge, setBuildingAge] = useState('0');
  const [propertyEffect, setPropertyEffect] = useState('No');
  const [security24x7, setSecurity24x7] = useState('No');
  const [isSalaried, setIsSalaried] = useState('Yes');
  const [showPremiumPrices, setShowPremiumPrices] = useState(false);
  const [errorMessages, setErrorMessages] = useState({
    currentMarketValue: '',
    carpetArea: '',
    pincode: '',
    buildingAge: '',
    duration: '',
  });

  return (
    <PropertyContext.Provider
      value={{
        currentMarketValue,
        setCurrentMarketValue,
        carpetArea,
        setCarpetArea,
        pincode,
        setPincode,
        buildingAge,
        setBuildingAge,
        propertyEffect,
        setPropertyEffect,
        security24x7,
        setSecurity24x7,
        isSalaried,
        setIsSalaried,
        showPremiumPrices,
        setShowPremiumPrices,
        errorMessages,
        setErrorMessages,
      }}
    >
      {children}
    </PropertyContext.Provider>
  );
};
